"""**4.Write a Python function that checks if a given number is prime or not from 1 to 200.**


"""

def is_prime(num):
    if num <= 1:
        return False
    for i in range(2, int(num**0.5) + 1):
        if num % i == 0:
            return False
    return True

def check_primes_in_range(start, end):
    primes = []
    for number in range(start, end + 1):
        if is_prime(number):
            primes.append(number)
    return primes

# Check for prime numbers from 1 to 200
prime_numbers = check_primes_in_range(1, 200)
print("Prime numbers from 1 to 200:", prime_numbers)

""" **5. Create an iterator class in Python that generates the Fibonacci sequence up to a specified number of terms.**

"""

class FibonacciIterator:

    def __init__(self, n):
        self.n = n
        self.a, self.b = 0, 1
        self.count = 0

    def __iter__(self):
        return self

    def __next__(self):
        if self.count < self.n:
            fib_number = self.a
            self.a, self.b = self.b, self.a + self.b
            self.count += 1
            return fib_number
        else:
            raise StopIteration

terms = 10
fibonacci_sequence = FibonacciIterator(terms)

print(f"Fibonacci sequence with {terms} terms:")
for number in fibonacci_sequence:
    print(number)

"""**6. Write a generator function in Python that yields the powers of 2 up to a given exponent.**"""

def powers_of_two(max_exponent):
    for exponent in range(max_exponent + 1):
        yield 2 ** exponent
max_exponent = 10
print("Powers of 2 up to 2^{}:".format(max_exponent))
for power in powers_of_two(max_exponent):
    print(power)

"""**7.  Implement a generator function that reads a file line by line and yields each line as a string.**"""

def read_file_lines(file_path):
    with open(file_path, 'r') as file:
        for line in file:
            yield line.strip()
file_path = 'example.txt'
try:
    for line in read_file_lines(file_path):
        print(line)
except FileNotFoundError:
    print(f"The file '{file_path}' does not exist.")

