"""**9.  Write a Python program that uses `map()` to convert a list of temperatures from Celsius to Fahrenheit.**

"""

def celsius_to_fahrenheit(celsius):
    return (celsius * 9/5) + 32
celsius_temperatures = [0, 20, 37, 100, -40]
fahrenheit_temperatures = list(map(celsius_to_fahrenheit, celsius_temperatures))
print("Celsius temperatures:", celsius_temperatures)
print("Fahrenheit temperatures:", fahrenheit_temperatures)

"""**10. Create a Python program that uses `filter()` to remove all the vowels from a given string.**"""

def remove_vowels(s):
    return ''.join(filter(lambda char: char not in 'aeiouAEIOU', s))

input_string = "I am Data Analysts Shivanshu"
result = remove_vowels(input_string)

print("Original string:", input_string)
print("String after removing vowels:", result)

"""**11. Imagine an accounting routine used in a book shop. It works on a list with sublists, which look like this:**
![image.png](data:image/png;base64,)


**Write a Python program, which returns a list with 2-tuples. Each tuple consists of the order number and the product of the price per item and the quantity. The product should be increased by 10,- € if the value of the order is smaller than 100,00 €.**

**Write a Python program using lambda and map.**

"""

# List of orders
orders = [
    [34587, "Learning Python, Mark Lutz", 4, 40.95],
    [98762, "Programming Python, Mark Lutz", 5, 56.80],
    [77226, "Head First Python, Paul Barry", 3, 32.95],
    [88112, "Einführung in Python3, Bernd Klein", 3, 24.99]
]

# Function to calculate the order total
def calculate_order(order):
    order_number = order[0]
    quantity = order[2]
    price_per_item = order[3]
    total = quantity * price_per_item

    # Increase by 10 if total is less than 100
    if total < 100:
        total += 10

    return (order_number, total)

# Using lambda and map to apply the function to each order
result = list(map(lambda order: calculate_order(order), orders))
print(result)